import React, { useEffect, useState } from "react";
import axios from "axios";

const App = () => {
  const [data, setData] = useState([]);

  const getData = async () => {
    const res = await axios("https://api.coingecko.com/api/v3/ping");
    setData(await res.data);
  };
  useEffect(() => {getData()}, []);

  console.log(data);
  return <h1>Hi</h1>;
};

export default App;
